  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return (
   <>
   <Router>
   <div className="page1"><Page1/></div>
   <Switch>
    <Route exact path="/cards"><Weather/></Route>
   </Switch>
   </Router>

   </>
  );
}

export default App;
